import React, { useState } from 'react'
import PropTypes from 'prop-types';
//

import { Container, Row, Col, Form, Button } from 'react-bootstrap';
import { PageBreadcrumb } from '../breadcrumb/Breadcrumb';
// import './dashboard.css';


// { onSubmit, handleChange, subject, issueDate, description }
export const NewTicketForm = () => {
    const [formData, setFormData] = useState({ subject: '', issueDate: '', description: '' });
    const { subject, issueDate, description } = formData;
    // const [loadForm, setLoadForm] = useState('login')


    const handleChange = (e) => {
        setFormData({ ...formData, [e.target.name]: e.target.value });
    }

    const onSubmit = (e) => {
        e.preventDefault();
        // if (!email || !password) {
        //     alert('please enter email')
        // }
        // setEmail(email);
        // setPassword(password);
        console.log(subject, issueDate, description);
    }


    return (
        <Container className="newTicket-container" >
            <Row>
                <Col>
                    <PageBreadcrumb pageName='New ticket' />
                </Col>
            </Row>
            <Row>
                <Container className="newTicket-form-container">
                    <Row>
                        <Col>
                            <h3 className="login-header"> Add new ticket</h3>
                            <hr />
                            <Form autoComplete="off" onSubmit={onSubmit}>
                                <Form.Group as={Row}>
                                    <Form.Label column sm={3}> Subject </Form.Label>
                                    <Col sm={9}>
                                        <Form.Control
                                            // type="email"
                                            name="subject"
                                            value={subject}
                                            onChange={handleChange}
                                            placeholder="Enter a subject"
                                            required
                                        />
                                    </Col>
                                </Form.Group>
                                <Form.Group as={Row}>
                                    <Form.Label column sm={3}> Issue found </Form.Label>
                                    <Col sm={9}>
                                        <Form.Control
                                            type="date"
                                            name="issueDate"
                                            value={issueDate}
                                            onChange={handleChange}
                                            required
                                        />
                                    </Col>
                                </Form.Group>
                                <Form.Group >
                                    <Form.Label > Description </Form.Label>
                                    <Form.Control as="textarea"
                                        name="description"
                                        // rows="4"
                                        rows={4}
                                        value={description}
                                        onChange={handleChange}
                                        placeholder="Enter a description"
                                        required
                                    />
                                </Form.Group>
                                <Button type="submit" block variant="info"> Save </Button>
                            </Form>
                        </Col>
                    </Row>
                </Container>
            </Row>
        </Container>
    )
}


NewTicketForm.propTypes = {
    handleChange: PropTypes.func.isRequired,
    onSubmit: PropTypes.func.isRequired,
    subject: PropTypes.string.isRequired,
    issueDate: PropTypes.date.isRequired,
    description: PropTypes.string.isRequired,
}

